import React from "react";

import produtos from '../../data/produtos'

export default props => {
    const itens = produtos.map(p => {
        return (
            <tr>
                <td>{p.id}</td>
                <td>{p.nome}</td>
                <td>R$ {p.preço}</td>
            </tr>
        )
    })

    return (
        <div>
            Tabela Produtos
            <table border={1}>
                <th>ID</th>
                <th>Nome</th>
                <th>Preço</th>
                {itens}
            </table>
        </div>

    )
}
